    "@I1067@",
    {
      "key": "@I1067@",
      "sex": "M",
      "name": {
        "name": "John William /Sowders/",
        "surname": "Sowders",
        "given": "John William",
        "suffix": "(#BH46)",
        "full": "John William SOWDERS (#BH46)"
      },
      "birth": {
        "date": "JAN 1796",
        "place": "Virginia, USA"
      },
      "death": {
        "date": "12 NOV 1858",
        "place": "Danville, Vermilion, Illinois, United States"
      },
      "span": "(JAN 1796 - 12 NOV 1858)",
      "label": "John William SOWDERS (#BH46) (JAN 1796 - 12 NOV 1858)",
      "families": [],
      "unions": [
        "@F287@"
      ],
      "notes": "1. Born in 1796, this John Sowders (#BH46) would have been 64 at the outbreak of the Civil War.  Furthermore, if he died in 1858 he certainly wasn't in the war./n/nSince John (#BH46) and his wife Elizabeth were both born and/or resided and died in Illinois, where their daughter Elizabeth Ann was known to be born, they are likely the correct parents of Elizabeth Ann (#BH23)./n/n2. There was a John W Sowders who was a private in Companies A &amp; F of the 4th Reg Illinois Cavalry.   This may have been their son John, who was born in 1823./n/nThere was also a John Sauder who served in Company G of the 2nd West VA Cavalry and had a widow named Elizabeth Souders./n/n3. The Sowders Family manuscripts state that John Prillaman Sowders, the son of Anna Prillaman and Jacob Sowders, was was born 4 Oct 1803 in Franklin Co, VA, and married a woman named Cynthia Craig in Montgomery Co, VA. on 4 Sep 1830.  So the wives' names do not match up, unless John Sowders married a second time./n/nTHEREFORE, it looks like Jacob Sowders and Anna Prillaman may NOT BE the parents of John WIlliam Sowders (#BH46)./nI have unlinked them, but they remain in the data tree./n/n4 The marriage date is also suspicious: John would have been 16 and Elizabeth 17."
    }
